t\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', '3', '0', '', '', '1', '0', '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', '0', '*', ''), ('67', '172', 'مدرب الشحانية القطري: انعدام الثقة وراء الخسارة من الغرافة', 'demonstrav-erunt-lert-praesent-luptatum-3', '<div style=\"padding: 0px; margin: 0px; color: #343434; font-family: Helvetica, Arial, sans-serif; font-size: 18px; line-height: 30px; text-align: right;\">أبدى فرناندو خوزيه المدير الفني لفريق الكرة بنادي الشحانية القطري اسفه من الخسارة التي تعرض لها فريقه على يد الغرافة بثلاثة أهداف نظيفة في المباراة التي أقيمت بينهما مساء اليوم بالجولة الثامنة من دوري نجوم قطر....</div>\r\n<div style=\"padding: 0px; margin: 0px; color: #343434; font-family: Helvetica, Arial, sans-serif; font-size: 18px; line-height: 30px; text-align: right;\"> </div>\r\n<div style=\"padding: 0px; margin: 0px; color: #343434; font-family: Helvetica, Arial, sans-serif; font-size: 18px; line-height: 30px; text-align: right;\">', ' وقال في المؤتمر الصحفي عقب المباراة:\" لقد كانت مواجهة صعبة وتوقعنا أن تكون هناك أخطاء من جانبنا لكن عدم الثقة كان السبب المباشر في الهزيمة الكبيرة ، عموماً كرة القدم ورغم أنها لعبة أخطاء إلا أنها لا تحتمل أخطاء متكررة ، وعندما ينافس أي فريق في الدوري فريق أكبر منه فإنه يدفع ثمن الأخطاء التي يرتكبها وأمام الغرافة دفعنا الثمن غالياً وقاسيا\".</div>\r\n<div style=\"padding: 0px; margin: 0px; color: #343434; font-family: Helvetica, Arial, sans-serif; font-size: 18px; line-height: 30px; text-align: right;\"> </div>\r\n<div style=\"padding: 0px; margin: 0px; color: #343434; font-family: Helvetica, Arial, sans-serif; font-size: 18px; line-height: 30px; text-align: right;\">وأشار مدرب الشحانية إلى أن فريقه كان الطرف الأفضل في اللقاء قبل أن تتلقى شباكه الهدف الأول بعد مرور أقل من ربع ساعة من المباراة ، وقال :\" لعب فريقي بطريقة جيدة وكان الأفضل إلى ما قبل الهدف الأول حيث كان اللاعبون يتحركون بطريقة جيدة بكرة وبدون كرة ولكن الهدف المبكر وجه ضربة معنوية للاعبين \".<br style=\"padding: 0px; margin: 0px;\" /> </div>\r\n<div style=\"padding: 0px; margin: 0px; color: #343434; font-family: Helvetica, Arial, sans-serif; font-size: 18px; line-height: 30px; text-align: right;\">على الجانب الآخر أكد باكتيا مدرب الغرافة أن فريقه حقق هدفه من المباراة وهو الفو وحصد الثلاث نقاط ، وهذا هو المهم على حد تعبيره ، وقال:\" الكثير من لاعبينا خاضوا ثلاثة مباريات في الأسبوع الماضي وكانت درجات الحرارة والرطوبة مرتفعة نسبياً ولذلك بين الشوطين طلبت من اللاعبين اللعب بحذر خوفاً من تعرضهم للاصابة أو الإجهاد الشديد\".</div>', '1', '31', '2014-08-12 12:59:21', '914', '', '2014-11-21 18:55:08', '914', '0', '0000-00-00 00:00:00', '2014-08-12 12:59:21', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/news\\/news-3.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"images\\/news\\/news_3.jpg\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', '7', '0', '', '', '1', '6', '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', '0', '*', ''), ('68', '173', 'السيلية يواجه الشحانية في لقاء مؤجل بالدوري القطري', 'demonstrav-erunt-lert-praesent-luptatum-4', '<div style=\"padding: 0px; margin: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 18px; line-height: 30px; text-align: right;\">يلتقي فريق السيلية مع الشحانية وذلك مساء يوم غدا الثلاثاء في المباراة المؤجلة من الأسبوع الثاني من دوري نجوم قطر وتقام المباراة على ملعب سعود بن عبد</div>\r\n<div style=\"padding: 0px; margin: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 18px; line-height: 30px; text-align: right;\">الرحمن بنادي الوكرة ....</div>\r\n<div style=\"padding: 0px; margin: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 18px; line-height: 30px; text-align: right;\"> </div>\r\n<div style=\"padding: 0px; margin: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 18px; line-height: 30px; text-align: right;\">', ' </div>\r\n<div style=\"padding: 0px; margin: 0px; color: #343434; font-family: Helvetica, Arial, sans-serif; font-size: 18px; line-height: 30px; text-align: right;\">مباراة الغد مهمة جدا للفريقين في ظل وضع كل فريق في جدول الترتيب حيث أن السيلية يحتل المركز الحادي عشر برصيد 8 نقاط والشحانية المركز الثالث عشر وقبل الأخير برصيد 5 نقاط ويهم كل منهما الحصول على النقاط الثلاثة والابتعاد عن شبح الهبوط الذي يهدد العديد من الفرق .<br style=\"padding: 0px; margin: 0px;\" /> </div>\r\n<div style=\"padding: 0px; margin: 0px; color: #343434; font-family: Helvetica, Arial, sans-serif; font-size: 18px; line-height: 30px; text-align: right;\">السيلية في وضعية جيدة حاليا بعدما نجح في الجولة الماضية في تحقيق الفوز على الوكرة بنتيجة 4 /3 في واحدة من المباريات القوية ، وعاد من خلالها للانتصارات وفريق الشحانية خسر برباعية نظيفة من الجيش وأصبح في وضع صعب جدا بجدول الترتيب ويحتاج إلى تحقيق انتصار من أجل التأكيد على قدرة الفريق في العودة من جديد بعد أن أصبح مهددا وبقوة مع فريق الشمال في الهبوط للدرجة الثانية حتى لو كان هذا الأمر مبكر الحديث عنه الآن .<br style=\"padding: 0px; margin: 0px;\" /> </div>\r\n<div style=\"padding: 0px; margin: 0px; color: #343434; font-family: Helvetica, Arial, sans-serif; font-size: 18px; line-height: 30px; text-align: right;\">وبصفة عامة المباراة لن تكون سهلة على الفريقين حيث أن كل فريق يريد الهروب من القاع والتقدم خطوة للأمام وهو ما يعطي للمباراة أهمية إضافية ويمتلك السيلية أفضلية نسبية في تلك المواجهة عن الشحانية الوافد الجديد على دوري نجوم قطر .</div>', '1', '31', '2014-08-12 12:59:21', '914', '', '2014-11-21 18:45:12', '914', '0', '0000-00-00 00:00:00', '2014-08-12 12:59:21', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/news\\/news-4.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"images\\/news\\/mom167_koo_sail.jpg\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create