-- ----------------------------
--  Table structure for `ulr1w_content_frontpage`
-- ----------------------------
DROP TABLE IF EXISTS `ulr1w_content_frontpage`;
CREATE TABLE `ulr1w_content_frontpage` (
  `content_id` int(11) NOT NULL DEFAULT '0',
  `ordering` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`content_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `ulr1w_content_rating`
-- ----------------------------
DROP TABLE IF EXISTS `ulr1w_content_rating`;
CREATE TABLE `ulr1w_content_rating` (
  `content_id` int(11) NOT NULL DEFAULT '0',
  `rating_sum` int(10) unsigned NOT NULL DEFAULT '0',
  `rating_count` int(10) unsigned NOT NULL DEFAULT '0',
  `lastip` varchar(50) NOT NULL DEFAULT '',
  PRIMARY KEY (`content_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
