r Content tab) for switching between them when one wants to use Joomla! as a multilingual site. <br />--The plugin \'System - Language Filter\' has to be enabled.--<br /> When switching languages and if the item displayed in the page is not associated to another item, the module redirects to the Home page defined for the chosen language.<br /> Otherwise, if the parameter is set for the Language filter plugin, it will redirect to the associated item in the language chosen. Thereafter, the navigation will be the one defined for that language. <br />If the plugin <strong>\'System - Language Filter\'</strong> is disabled, this may have unwanted results.<br /><strong>Method:</strong><br />1. Open Language Manager Content tab and make sure the Languages you want to use in contents are published and have a Language Code for the URL as well as prefix for the image used in the module display.<br />2. Create a Home page by assigning a language to a menu item and defining it as Default Home page for each published content language. <br />  3. Thereafter, you can assign a language to any Article, Category, Module, Newsfeed, Weblinks in Joomla.<br /> 4. Make sure the module is published and the plugin is enabled. <br /> 5. When using associated items, make sure the module is displayed on the pages concerned. <br />6. The way the flags or names of the languages are displayed is defined by the ordering in the Language Manager - Content Languages.<br ><br >If this module is published, it is suggested to publish the administrator multilingual status module.', 'D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_languages.ini'), ('2538', 'MOD_LANGUAGES', 'Language Switcher', 'D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_languages.sys.ini'), ('2539', 'MOD_LANGUAGES_XML_DESCRIPTION', 'This module displays a list of available Content Languages (as defined and published in Language Manager Content tab) for switching between them when one wants to use Joomla! as a multilingual site. <br />--The plugin \'System - Language Filter\' has to be enabled.--<br /> When switching languages and if the item displayed in the page is not associated to another item, the module redirects to the Home page defined for the chosen language.<br /> Otherwise, if the parameter is set for the Language filter plugin, it will redirect to the associated item in the language chosen. Thereafter, the navigation will be the one defined for that language. <br />If the plugin <strong>\'System - Language Filter\'</strong> is disabled, this may have unwanted results.<br /><strong>Method:</strong><br />1. Open Language Manager Content tab and make sure the Languages you want to use in contents are published and have a Language Code for the URL as well as prefix for the image used in the module display.<br />2. Create a Home page by assigning a language to a menu item and defining it as Default Home page for each published content language. <br />  3. Thereafter, you can assign a language to any Article, Category, Module, Newsfeed, Weblinks in Joomla.<br /> 4. Make sure the module is published and the plugin is enabled. <br /> 5. When using associated items, make sure the module is displayed on the pages concerned. <br />6. The way the flags or names of the languages are displayed is defined by the ordering in the Language Manager - Content Languages.<br ><br >If this module is published, it is suggested to publish the administrator multilingual status module.', 'D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_languages.sys.ini'), ('2540', 'MOD_LANGUAGES_LAYOUT_DEFAULT', 'Default', 'D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_languages.sys.ini'), ('2541', 'MOD_LOGIN', 'Login', 'D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_login.ini'), ('2542', 'MOD_LOGIN_FIELD_GREETING_DESC', 'Show/Hide the simple greeting text', 'D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_login.ini'), ('2543', 'MOD_LOGIN_FIELD_GREETING